import React from 'react';

function StatsElement(props) {
    return(
        <div>
            <span>Hp: {props.hp}</span>
            <span>Attack: {props.attack}</span>
            <span>Defense: {props.defense}</span>
            <span>Sp Attack: {props.spattack}</span>
            <span>Sp Defense: {props.spdefense}</span>
            <span>Speed: {props.speed}</span>


        </div>
    );
}


export default StatsElement;
